program test
    implicit none
    integer neq, nx, nMaxSubintervals, fdim, idim
    parameter(neq=6, nx=301, nMaxSubintervals=60000, &
              fdim=nMaxSubintervals*965,idim=nMaxSubintervals*30)
    integer ncomp, ny, orders(neq),i,j
    integer ipar(12), ispace(idim), ltol(neq), iflag
    double precision left,right,fspace(fdim),x,z(neq),y(0)
    double precision sides(neq), tol(neq), fixpnt(0)
    external fsub,dfsub,gsub,dgsub,loadTableGuess,tableGuess
    character(len = 32) :: outFormat = '(32(e19.12,1x))'
    common /param/ lam
    double precision lam

    ! Choose coupling constant
    lam = 21.5

    ! Load the guess from a file
    call loadTableGuess()

    ! Generate the inital mesh to match the guess
    do i=1,nx
        fspace(i)=dfloat(i-1)/dfloat(nx-1)
    enddo
    ispace(1)=nx-1


    ncomp=neq;
    ny=0;
    left = fspace(1) ! left end of interval
    right = fspace(ispace(1)+1) ! right end of interval

    do i=1,neq
        orders(i)=1  ! the order of the i'th differential eq.
        tol(i)=0.01
        ltol(i)=i
        if(i <= neq/2) then
            sides(i)=left ! boundary condition point
        else
            sides(i)=right
        endif
    enddo

    ipar(1)=1 ! problem is nonlinear
    ipar(2)=0 ! auto num of collocation points
    ipar(3)=ispace(1) ! num of subintervals
    ipar(4)=neq ! number of tolerances
    ipar(5)=fdim ! dim of fspace
    ipar(6)=idim ! dim of ispace
    ipar(7)=1 ! -1 for full printout
    ipar(8)=2 ! we supply the mesh
    ipar(9)=1 ! we supply a guess
    ipar(10)=0 ! problem is regular
    ipar(11)=0 ! no fixed points
    ipar(12)=0 ! dae index

    write(*,*) "start"

    ! call cpu_time(start)
    call colnew(ncomp,orders,left,right,sides,ipar,ltol,tol,fixpnt, &
                ispace,fspace,iflag,fsub,dfsub,gsub,dgsub,tableGuess)

!             call cpu_time(finish)
!             print '("Time = ",f14.9," seconds for 50000.")',
!      .       (finish-start)



    write(*,*) "iflag = ", iflag

    if(iflag == 1) then
        open(100,file=trim("result4.txt"))
        do i = 1, ispace(1)+1
            x = fspace(i)
            call appsln(x,y,fspace,ispace)
            write(100,outFormat) x,z(1:6)
        enddo
        close(100)
    endif

end




! z = (f1,f1'), y = (f2)
! fsub computes the derivatives of the funcions
! the six functions are: f0, f0_x, f1, f1_x, b, b_x
! where _x denotes the derivative wrt the compactified coord. x

subroutine fsub(x, funcs, ders)
    implicit none
    double precision x, funcs(6), ders(6)
    double precision f0,f0_x, cf0,cf0_r,cf0_rr, cf0_xx,f0_xx
    double precision f1,f1_x, f1_r,f1_rr,       f1_xx
    double precision b,b_x,   a0,a0_r,a0_rr,    a0_xx,b_xx

    double precision r,dxdr,drdx,drdx_r,q,q_x,q_xx
    double precision E,exf1
    double precision lam
    common /param/ lam


    ! the transformed variables and x-derivatives
    f0=funcs(1); f0_x=funcs(2)
    f1=funcs(3); f1_x=funcs(4)
    b =funcs(5); b_x =funcs(6)

    ! transformation x->r
    r=1.0/(1.0-x)
    dxdr=(x-1.0)**2
    drdx=1.0/dxdr
    drdx_r=(-2.0)/(x-1.0)
    q=x**2
    q_x=2.0*x
    q_xx=2.0

    ! the natural variables and their r-derivatives
    cf0 = f0*q
    a0 = b*q
    cf0_r = (q_x*f0 + q*f0_x)*dxdr
    f1_r  = f1_x*dxdr
    a0_r  = (q_x*b + q*b_x)*dxdr

