subroutine gsub(i,z,g)
    parameter(nc=6,ne=6)
    implicit double precision(a-h,o-z)
    double precision z(nc)

    goto(1,2,3,4,5,6),i
    1 continue
    g=z(2)-z(1)
    return
    2 continue
    g=z(4)+2.d0
    return
    3 continue
    g=z(6)-z(5)
    return

    4 continue
    g=z(1)-1.d0
    return
    5 continue
    g=z(3)-0.d0
    return
    6 continue
    g=z(5)-0.d0
    return
end

subroutine dgsub(i,z,dg)
    parameter(nc=6,ne=6)
    implicit double precision(a-h,o-z)
    double precision z(nc),dg(nc)

    do j=1,nc
       dg(j)= 0.d0
    enddo

    goto(1,2,3,4,5,6),i
    1 continue
    dg(1)=-1.d0
    dg(2)=1.d0
    return
    2 continue
    dg(4)=1.d0
    return
    3 continue
    dg(5)=-1.d0
    dg(6)=1.d0
    return

    4 continue
    dg(1)=1.d0
    return
    5 continue
    dg(3)=1.d0
    return
    6 continue
    dg(5)=1.d0
    return
end



subroutine loadTableGuess()
    parameter(nc=6,ne=6,nTableRows=1001)
    double precision tableValue(nTableRows,10)
    common tableValue

    open(99,file="guesstable.txt")
    do i=1, nTableRows
        read(99,*) tableValue(i,:)
    enddo
    close(99)
end

subroutine tableGuess(x,z,dmval)      ! initial guess

    parameter(nc=6,ne=6,nTableRows=1001)
    double precision x,z(nc),dmval(ne)
    double precision leftWeight;
    double precision tableValue(nTableRows,10)
    common tableValue
    integer rowLeft

    rowLeft = int(x*(nTableRows-1))+1;
    leftWeight = 1-((x*(nTableRows-1))+1-dble(rowLeft));

    do i=1,6
        z(i)=leftWeight*tableValue(rowLeft,1+i)+   (1-leftWeight)*tableValue(min(rowLeft+1,nTableRows),1+i);
    enddo
    do i=1,6,2
        dmval(i)=leftWeight*tableValue(rowLeft,2+i)+ (1-leftWeight)*tableValue(min(rowLeft+1,nTableRows),2+i);
        dmval(i+1)=leftWeight*tableValue(rowLeft,8+(i-1)/2)+   (1-leftWeight)*tableValue(min(rowLeft+1,nTableRows),8+(i-1)/2);
    enddo
    !  dmval(:)=0;

    return
end
